import "./ProductTable.css";

export default function ProductTable({ products }) {
  if (products.length === 0) {
    return <div>No products found.</div>;
  }

  return (
    <table class="tabel">
      <thead>
        <tr>
          <th></th>
          <th>Name</th>
          <th>Price</th>
          <th>Category</th>
          <th>Date posted</th>
        </tr>
      </thead>
      <tbody>
        {products.map((p) => (
          <tr key={p.id}>
            <td>{p.id}</td>
            <td>{p.name}</td>
            <td>{p.price}</td>
            <td>{p.category}</td>
            <td>{p.date}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
